TITLE:
  - "Cut Cartesian background element with a NURBS cut element with a straight interface"
PROBLEM TYPE:
  PROBLEMTYPE: "Structure"
  SHAPEFCT: "Nurbs"
IO/RUNTIME VTK OUTPUT:
  INTERVAL_STEPS: 1
IO/RUNTIME VTK OUTPUT/STRUCTURE:
  OUTPUT_STRUCTURE: true
  DISPLACEMENT: true
  ELEMENT_OWNER: true
  ELEMENT_GID: true
  ELEMENT_GHOSTING: true
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  DYNAMICTYPE: "Statics"
  TIMESTEP: 1
  NUMSTEP: 1
  MAXTIME: 2
  M_DAMP: 1e-05
  K_DAMP: 1e-05
  TOLDISP: 1e-07
  TOLRES: 1e-07
  MAXITER: 20
  LINEAR_SOLVER: 1
SOLVER 1:
  SOLVER: "UMFPACK"
  NAME: "Struct_Solver"
XFEM GENERAL:
  GMSH_DEBUG_OUT: true
  GMSH_CUT_OUT: true
CUT GENERAL:
  GENERAL_POSITION_DISTANCE_FLOATTYPE: "double"
  GENERAL_POSITION_POSITION_FLOATTYPE: "double"
  DO_SELFCUT: false
  BOUNDARYCELL_CUBATURDEGREE: 5
EMBEDDED MESH COUPLING:
  COUPLING_STRATEGY: mortar
  MORTAR_SHAPE_FUNCTION: nurbs9
  CONSTRAINT_ENFORCEMENT: penalty
  CONSTRAINT_ENFORCEMENT_PENALTYPARAM: 100
DESIGN EMBEDDED SOLID VOL BACKGROUND CONDITIONS:
  - E: 2
    COUPLINGID: 1
MATERIALS:
  - MAT: 1
    MAT_Struct_StVenantKirchhoff:
      YOUNG: 1
      NUE: 0.3
      DENS: 7.8e-07
DESIGN POINT DIRICH CONDITIONS:
  - E: 1
    NUMDOF: 3
    ONOFF: [1, 1, 1]
    VAL: [0, 0, 0]
    FUNCT: [0, 0, 0]
  - E: 2
    NUMDOF: 3
    ONOFF: [1, 0, 1]
    VAL: [0, 0, 0]
    FUNCT: [0, 0, 0]
  - E: 3
    NUMDOF: 3
    ONOFF: [0, 1, 1]
    VAL: [0, 0, 0]
    FUNCT: [0, 0, 0]
  - E: 4
    NUMDOF: 3
    ONOFF: [0, 0, 1]
    VAL: [0, 0, 0]
    FUNCT: [0, 0, 0]
DESIGN SURF DIRICH CONDITIONS:
  - E: 2
    NUMDOF: 3
    ONOFF: [0, 0, 1]
    VAL: [0, 0, -0.1]
    FUNCT: [0, 0, 0]
DESIGN EMBEDDED MESH SOLID SURF COUPLING CONDITIONS:
  - E: 1
    COUPLINGID: 1
STRUCTURE KNOTVECTORS:
  PATCHES:
    - KNOT_VECTORS:
        - DEGREE: 2
          TYPE: Interpolated
          KNOTS:
            - 0.0
            - 0.0
            - 0.0
            - 1.0
            - 1.0
            - 1.0
        - DEGREE: 2
          TYPE: Interpolated
          KNOTS:
            - 0.0
            - 0.0
            - 0.0
            - 1.0
            - 1.0
            - 1.0
        - DEGREE: 2
          TYPE: Interpolated
          KNOTS:
            - 0.0
            - 0.0
            - 0.0
            - 1.0
            - 1.0
            - 1.0
      ID: 1
